description:
Metal Slug 3

to start of game click on &quot;WinKawaks&quot;

your going to have to load the game
go to &quot;File&quot; --- &quot;Load Game&quot;

Load the first game and click &quot;ok&quot;

After your loaded the game 
click &quot;Game&quot;
go to where it says &quot;Redefine Keys&quot;
and click the one where it says player 1 to see the keys for player 1
